// src/components/TablaEstudiantes.jsx
import React from "react";

const TablaEstudiantes = ({ estudiantes, onEliminar }) => {
  return (
    <table border="1" cellPadding="8">
      <thead>
        <tr>
          <th>ID</th>
          <th>NÃºmero de Control</th>
          <th>Nombre</th>
          <th>Carrera</th>
          <th>Semestre</th>
          <th>Correo</th>
          <th>Acciones</th>
        </tr>
      </thead>
      <tbody>
        {estudiantes.map((est) => (
          <tr key={est.id}>
            <td>{est.id}</td>
            <td>{est.numero_control}</td>
            <td>{est.nombre_completo}</td>
            <td>{est.carrera}</td>
            <td>{est.semestre}</td>
            <td>{est.correo}</td>
            <td>
              <button onClick={() => onEliminar(est.numero_control)}>Eliminar</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default TablaEstudiantes;
